DataPet.data_pet_fues = {
	[10031] = {base_id = 10031, need_lev_break_times = 1, need_lev = 105, loss = {{21230,5}}, story = "他们中的每一个都是自身所处时代中的最强剑客，虽然无数年来在冥界游荡不定，但是现在，值此绯月生死存亡之际，他们再次响应后辈的召唤，以深爱的故乡与手中的利剑为名，冲破冥界的桎梏，重新回返绯月世界。"},
	[10032] = {base_id = 10032, need_lev_break_times = 1, need_lev = 105, loss = {{21231,5}}, story = "创世之初，天地间一片黑暗，一盏明灯被创世神置于天地正中，从此，这世上便有了光。当明灯随创世神离去时，滴落在大地各处的灯油逐渐有了自己的意识，当守护大陆的英雄开始召唤，她们就会以灯为魂，以气为体，破土重生。"},
	[10033] = {base_id = 10033, need_lev_break_times = 1, need_lev = 110, loss = {{21232,5}}, story = "防守、蓄势、反击、绝杀！绝地武士曾经面临多次险境，坚定的信念让他一次次化险为夷。灼热的信念覆盖剑气，必胜的气势压倒一切！"},
	[10034] = {base_id = 10034, need_lev_break_times = 1, need_lev = 110, loss = {{21233,5}}, story = "奇幻精灵沉醉于元素的魅力无法自拔，甚至因此摧毁了曾经的家园。元素道路上的探索尽管艰辛，但对这群元素狂热者来说，也许这才是永恒的归宿吧!"},
	[10035] = {base_id = 10035, need_lev_break_times = 1, need_lev = 120, loss = {{21234,5}}, story = "幽冥行者是游走在黑夜中的精灵，没人见识过她们的真是面目，因为当你看到她们时，你已经死了。死亡是他们人生唯一的信条！"},
	[10036] = {base_id = 10036, need_lev_break_times = 1, need_lev = 120, loss = {{21235,5}}, story = "远古时期女王由于对魔法的滥用，被冰封在极北之域。经过了漫长的岁月，冰晶与女王逐渐融为一体，冰晶女王已经觉醒，开始感受被女王支配的恐怖吧!"},
	[10037] = {base_id = 10037, need_lev_break_times = 0, need_lev = 90, loss = {{21236,5}}, story = "曾是绯月大陆的神奇魔镜，据说给主人源源不断的魔力。心意相通便会幻身为镜仙，陪伴守护在主人左右。"}
}
